import React from 'react'
import Manifest from './manifest.json'

const Section = (data) => {
    var i = data.data
    return (
    <div className='grid grid-row-3 p-5 shadow text-center'>
        <div className='font-bold text-lg leading-0 opacity-90 lg:text-base mb-2'>{i.heading}</div>
        <div className='font-medium text-base leading-0 opacity-90 lg:text-xl'>{i.paragraph}</div>
    </div>
    )
}

const TheWhy = () => {
    return (
    <div className='bg-white p-10'>
        <div className='font-extrabold text-2xl opacity-90'>{Manifest.title}</div>
        <div className='grid grid-col-aut4'>
        {Manifest.content.map((i, key) => {
                return <Section key={key} data={i}/>;
                })}
        </div>
    </div>
    )
}

export default TheWhy
